import React from "react";
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, makeStyles } from "@mui/material";

const useStyles = makeStyles((theme) => ({
  container: {
    background: "linear-gradient(to bottom, #a3a4a8, #f9f9f9)", // Define your gradient here
  },
  table: {
    minWidth: 650,
  },
}));

const OwnerHome = () => {
  const classes = useStyles();

  return (
    <div className={classes.container}>
      <TableContainer component={Paper}>
        <Table className={classes.table} aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell>Header 1</TableCell>
              <TableCell align="right">Header 2</TableCell>
              <TableCell align="right">Header 3</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            <TableRow>
              <TableCell>Row 1, Cell 1</TableCell>
              <TableCell align="right">Row 1, Cell 2</TableCell>
              <TableCell align="right">Row 1, Cell 3</TableCell>
            </TableRow>
            <TableRow>
              <TableCell>Row 2, Cell 1</TableCell>
              <TableCell align="right">Row 2, Cell 2</TableCell>
              <TableCell align="right">Row 2, Cell 3</TableCell>
            </TableRow>
            {/* Add more rows as needed */}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};

export default OwnerHome;
